The &lt;a href="2016%20International%20Women%27s%20Football%20Tournament%20of%20Manaus"&gt;2016 International Women's Football Tournament of Manaus&lt;/a&gt; (also known as the 2016 Torneio Internacional de Manaus de Futebol Feminino) is an invitational &lt;a href="association%20football"&gt;football&lt;/a&gt; tournament held every December in Brazil. The 2016 tournament will from December 7–18, 2016.
Tournament rules allow a 23-member roster. Players marked (&lt;a href="Captain%20%28association%20football%29"&gt;c&lt;/a&gt;) were named as captain for their national squad. Totals for caps and goals, club affiliations, and ages are as of the opening day of the tournament on 7 December 2016.
